import React from 'react';
import ReactDOM from 'react-dom';
import '../src/App.css';
import App from './App';
import ThemeProvider from './ThemeProvider'
import './index.scss'



ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider>
      <App />
    </ThemeProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
